import { PageHeader, Divider, Input, Badge, Avatar } from "antd";
import css from "./style.module.css"
import { Link } from "react-router-dom";
import { createFromIconfontCN } from '@ant-design/icons';
const IconFont = createFromIconfontCN({
    scriptUrl: '//at.alicdn.com/t/font_8d5l8fzk5b87iudi.js',
  })
const { Search } = Input;
export const Header = () => {
  return (
    <>
      <div className={css.header}>
        <Link to="/">
          <PageHeader  style={{ display: "flex", justifyContent: "space-between"}} title="Good shop" > 
          <Search   placeholder="Введите название товара" style={{ width: 500}} />
          <Badge  count={1}>
            <Avatar style={{ backgroundColor: "#ffffff"}} shape="square" size="large">
              <img
                src="data:image/svg+xml;charset=utf-8,%3Csvg viewBox='0 0 20 20' xmlns='http://www.w3.org/2000/svg' height='19' width='19'%3E%3Cpath d='M18 17.987V7H2v11l16-.013zM4.077 5A5.996 5.996 0 0110 0c2.973 0 5.562 2.162 6.038 5H20v14.986L0 20V5h4.077zm9.902-.005C13.531 3.275 11.86 2 10 2 8.153 2 6.604 3.294 6.144 4.995c.92 0 7.654.03 7.835 0z' fill='23FFF'/%3E%3C/svg%3E"
                alt=""
              />

            </Avatar>
          </Badge>
          </PageHeader>
          <Divider />
        </Link>
      </div>
    </>
  );
};
